// Part 1: Parse CSV File
const parseCsvFile = async (context: AdvancedContext) => {
  const { state, globalState } = context;
  const { fileContent } = state;
  const { csvData } = globalState;

  if (!fileContent) {
    throw new Error("File content is required");
  }

  const lines = fileContent.split("\n");
  const headers = lines[0].split(",");
  const data = lines.slice(1).map((line) => line.split(","));

  csvData.push({ headers, data });

  return {
    csvData,
  };
};

const parseCsvFilePart: Part = {
  id: "parseCsvFile",
  inputs: [
    { id: "fileContent", type: "string" },
    { id: "csvData", type: "array" },
  ],
  outputs: [{ id: "csvData", type: "array" }],
  completionType: "output",
  fn: parseCsvFile,
};
